import React from 'react';
import './NavBar.css';

const NavBar: React.FC = () => {
    const links = [
        { name: 'Home', url: '/' },
        { name: 'About', url: '/'},
        { name: 'Products', url: '/' }
    ]

    const renderLinks = () => {
        var renderedLinks = []

        for (let i = 0; i < links.length; i++)
            renderedLinks.push(
                <li>
                    <a href={ links[i].url }>{ links[i].name }</a>
                </li>
            )

        return renderedLinks
    }

    return (
        <div id="NavBar">
            <h1>Lynette's Skin Studio</h1>
            <ul>
                { renderLinks() }
            </ul>
        </div>
    )
}

export default NavBar
